import React, { Component } from 'react';
import { IconButton, Icon, ScrollView } from "native-base";
import { MaterialIcons } from "@expo/vector-icons";
import { FontAwesome } from "@expo/vector-icons";
import { useNavigation } from '@react-navigation/native';

import {
  StyleSheet,
  Text,
  View,
  Image,
} from 'react-native';

export default function Profile () {
  const navigation = useNavigation();

    return (
      <ScrollView
        vertical={true} 
        >

      <View style={styles.container}>
          <View style={styles.header}>
            <View style={styles.headerContent}>
                <Image style={styles.avatar}
                  source={{uri: 'https://photos.angel.co/users/13380692-medium_jpg?1626195560'}}/>

                <Text style={styles.name}>Ghadah Bu Dhhair </Text>
                <Text style={styles.userInfo}>ghadah@gmail.com </Text>
                <Text style={styles.userInfo}>üìçKuwait City </Text>
            </View>
          </View>

          <View>
            <View>
              <IconButton 
              icon={
                <Icon 
                as={<MaterialIcons name="house" />}
                size="sm"
                color="black"
                onPress={() => navigation.navigate("Home")}
                />
              }
              />
                <Text>Home</Text>
              </View>
              <View>
              <IconButton 
              icon={
                <Icon 
                as={<FontAwesome name="heart" />}
                size="sm"
                color="black"
                onPress={() => navigation.navigate("Home")}
                />
              }
              />
                <Text>Favorite</Text>
              </View>
              <View>
              <IconButton 
              icon={
                <Icon 
                as={<MaterialIcons name="filmstrip" />}
                size="sm"
                color="black"
                onPress={() => navigation.navigate("Home")}
                />
              }
              />
                <Text>My Trips</Text>
              </View>
              <View>
              <IconButton 
              icon={
                <Icon 
                as={<MaterialIcons name="airplanemode-active" />}
                size="sm"
                color="black"
                onPress={() => navigation.navigate("Home")}
                />
              }
              />
                <Text>Settings</Text>
              </View>


          </View>
      </View>
      </ScrollView>
    );
  }


const styles = StyleSheet.create({
  header:{
    backgroundColor: "#DCDCDC",
  },
  headerContent:{
    padding:30,
    alignItems: 'center',
  },
  avatar: {
    width: 130,
    height: 130,
    borderRadius: 63,
    borderWidth: 4,
    borderColor: "white",
    marginBottom:10,
  },
  name:{
    fontSize:22,
    color:"#000000",
    fontWeight:'600',
  },
  userInfo:{
    fontSize:16,
    color:"#778899",
    fontWeight:'600',
  },
  body:{
    backgroundColor: "#778899",
    height:500,
    alignItems:'center',
  },
  item:{
    flexDirection : 'row',
  },
  infoContent:{
    flex:1,
    alignItems:'flex-start',
    paddingLeft:5
  },
  iconContent:{
    flex:1,
    alignItems:'flex-end',
    paddingRight:5,
  },
  icon:{
    width:30,
    height:30,
    marginTop:20,
  },
  info:{
    fontSize:18,
    marginTop:20,
    color: "#FFFFFF",
  }
});

